import React from 'react';
import '../assets/styles/Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 Shopify. All rights reserved.</p>
      <p>
        <a href="/contact">Contact Us</a> | <a href="/privacy">Privacy Policy</a>
      </p>
    </footer>
  );
};

export default Footer;
